import React, { Component } from 'react';
import { Navbar, Form, Button, Row, Col, Container } from 'react-bootstrap';

import GlobalStyleSheet from '../styleSheet';
const styles = {
    submit_btn: {
        // background: `${GlobalStyleSheet.primry_color}`,
        // background: 'white',
        border: 'none',
        marginTop: '50px',
    },
    container: {
        background: `${GlobalStyleSheet.primry_color}`,
        marginTop: '50px',
        padding: '50px'
    },
    label: {
        color: `${GlobalStyleSheet.primary_text_color}`,
        marginRight: '10px',
    },
}
class Login extends Component {
    state = {}
    render() {
        return (
            <div>
                <Navbar variant="dark" style={{ background: `${GlobalStyleSheet.primry_color}` }}>
                    <Navbar.Brand href="/" className="mr-auto" > Muhalik    </Navbar.Brand>
                </Navbar>
                <Row>
                    <div className="mr-auto"></div>
                    <div style={styles.container} className="mr-auto">
                    <Navbar.Brand href="#" className="mr-auto" > Login    </Navbar.Brand>

                        <Form>
                            <Form.Group controlId="formBasicEmail">
                                <Form.Label>Email address</Form.Label>
                                <Form.Control type="email" placeholder="Enter email" />
                                {/* <Form.Text className="text-muted"> We'll never share your email with anyone else. </Form.Text> */}
                            </Form.Group>

                            <Form.Group controlId="formBasicPassword">
                                <Form.Label>Password</Form.Label>
                                <Form.Control type="password" placeholder="Password" />
                            </Form.Group>

                            <Form.Group controlId="formBasicCheckbox">
                                <Form.Check type="checkbox" label="Check me out" />
                            </Form.Group>

                            <Button variant="light" block type="submit" style={styles.submit_btn}> Login </Button>
                            <Button variant="light" block> Signup </Button>
                        </Form>
                    </div>
                </Row>
            </div>
        );
    }
}

export default Login;
